def count_occurences(strings: List[str]) -> dict:
    """Count number of occurrences of each word in a list.

    >>> count_occurences([])
    {}
    >>> count_occurences(['a', 'b', 'c'])
    {'a': 1, 'b': 1, 'c': 1}
    >>> count_occurences(['a', 'b', 'c', 'a', 'b'])
    {'a': 2, 'b': 2, 'c': 1}
    >>> count_occurences(['a', 'a', 'a', 'b', 'b'])
    {'a': 3, 'b': 2}
    """
    occurences = {}
    for s in strings:
        if s in occurences:
            occurences[s] += 1
        else:
            occurences[s] = 1
    return occurences


def most_frequent(strings: List[str]) -> str:
    "Return the most frequent string in a list of strings."

    count = count_occurences(strings)
