    def enqueue(self, value: int) -> bool:
        if self.isFull():
            return False
        self.array[self.tail] = value
        self.tail = (self.tail + 1) % len(self.array)
        self.size += 1

    def dequeue(self) -> bool:
        if self.isEmpty():
            return False
        head = self.array[self.head]
