def radix_sort(strings: List[str], sort_by_length: bool = False) -> List[str]:
     "Return a list of sorted strings
    >>> radix_sort(['e', 'abcd', 'a', 'bcc', 'd', 'ab'])
    ['a', 'd', 'ab', 'e', 'bcd', 'bcc']
    >>> radix_sort(['e', 'abcd', 'a', 'bcc', 'd', 'ab'], sort_by_length=True)
    ['ab', 'd', 'a', 'e', 'bcd', 'bcc']
    """"""
    if sort_by_length:
        return sorted(strings, key=lambda x: len(x))
    else:
        if len(strings) <= 1:
            return strings
        else:
            left = []
            right = []
            middle = strings[0]
            for i in range(1, len(strings)):
                if strings[i] <= middle:
                    left.append(strings[i])
                else:
                    right.append(strings[i])
            return radix_sort(left) + [middle] + radix_sort(right)
