class Tree:
    def __init__(self):
        self.root = None
    def add(self, value):
        if self.root == None:
            self.root = TreeNode(value)
        else:
            current_node = self.root
            while True:
                if value < current_node.value:
                    if current_node.left!= None:
                        current_node = current_node.left
                    else:
                        current_node.left = TreeNode(value)
                        break
                else:
                    if current_node.right!= None:
