                        break
    def in_order(self):
        result = []
        def traverse(root):
            if root == None:
                return
            traverse(root.left)
            result.append(root.value)
            traverse(root.right)
        traverse(self.root)
        return result
    def pre_order(self):
        result = []
        def traverse(root):
            if root == None:
                return
            result.append(root.value)
            traverse(root.left)
            traverse(root.right)
        traverse(self.root)
        return result

    def post_order(self):
        result = []
        def traverse(root):
            if root == None:
                return
            traverse(root.left)
            traverse(root.right)
            result.append(root.value)
        traverse(self.root)
        return result
    def level_order(self):
        result = []
