        "Given an array of positive integers nums and a positive integer target, return the minimal length of a contiguous subarray of which the sum is greater than or equal to target. If there is no such subarray, return 0 instead. Example 1: Input: target = 7, nums = [2,3,1,2,4,3] Output: 2 Explanation: The subarray [4,3] has the minimal length under the problem constraint. Example 2: Input: target = 4, nums = [1,4,4] Output: 1 Explanation: The subarray [4] has the minimal length under the problem constraint. Example 3: Input: target = 11, nums = [1,1,1,1,1,1,1,1] Output: 0 Example 4: Input: target = 1, nums = [1,1] Output: 2 Example 5: Input: target = 100, nums = [1,1,1,1,1,1,1,1] Output: 1
    """



        """
        minSubArrayLen
        Time : O(n)
        Space : O(1)
        """
        left,right=0,0
        min_len=len(nums)+1
        res=0
        while right<len(nums):
            while res<target:
                res+=nums[right]
                right+=1
            while res>=target:
                min_len=min(min_len,right-left)
                res-=nums[left]
                left+=1
        if min_len==len(nums)+1:
            return 0
        else:
            return min_len

