class Solution2:
    """
    A clever solution that takes O(n) time and space.

    1. Build an in-place dictionary (a hash map) that records the first number that sums with any other to get the target.
    2. Use this dictionary to check if the remaining numbers in the array match with numbers already in the dictionary.
    """
    def twoSum(self, nums: List[int], target: int) -> List[int]:
        dic = dict()
        for idx, num in enumerate(nums):
            first_idx = dic.get(target - num)
            if first_idx is not None:
                return [first_idx, idx]
            dic[num] = idx

        return []

class Solution3:
    """
    Even more clever approach that only takes O(n) space
    """
    def twoSum(self, nums: List[int], target: int) -> List[int]:
        left = 0
        right = len(nums) - 1

        while left < right:
            current_sum = nums[left] + nums[right]

            if current_sum == target:
                return [left + 1, right + 1]
            elif current_sum > target:
                right -= 1
            else:
                left += 1

        return []

